export function getData() {
  const getData = () => {
    fetch("https://univer.honest-people.by/data/extreme.json", {})
      .then(function (response) {
        return response.json();
      })
      .then(function (myJson) {
        console.log(myJson);
        return myJson;
      });
  };
  getData()
}
